import styles from './Column.module.scss';
import Card from '../Card/Card';

const Column = props => {
  return (
    <article className={styles.column}>
      <span className={styles.icon + ' fa fa-' + props.icon} />
      <h2 className={styles.title}>{props.title}</h2>
      <Card />

    </article>
  );
};

export default Column;
